#include <string.h>
#include<stdlib.h>

float **enframe(const float x[], int srclength, int framelength, int step)
{

    int nf = (srclength - framelength + step) / step;//算出帧数
    float **yenframe=(float **)malloc(sizeof(float*)*nf);
    for (int i = 0; i < nf; i++)
    {
        yenframe[i] = (float *)malloc(sizeof(float)*framelength);
    }
    int count = 0;
    int startNo = 0; 
    while (count < nf)
    {    
        for (int i = 0; i < framelength; i++)
        {
            yenframe[count][i] = x[startNo + i];
        }
        count++;
        startNo += step;
    }
    
    return yenframe; 
}
    
